`user script`;function buildMedias(inputURL){const q=inputURL.split("-");const offset=(parseInt(q[1])-1)*20;const url="https://zh.stripchat.com/api/front/models?limit=20&offset="+offset+"&primaryTag=girls&filterGroupTags="+q[0]+"&sortBy=stripRanking";const req={url:url,method:"GET",};$http.fetch(req).then(res=>{const items=JSON.parse(res.body).models;var datas=[];items.forEach(item=>{if(item.status=="public"){const title=item.username;const href=item.hlsPlaylist;const coverURLString=item.previewUrlThumbBig;const descriptionText="";datas.push(buildMediaData(href,coverURLString,title,descriptionText,href))}});$next.toMedias(JSON.stringify(datas))})}function Episodes(inputURL){let datas=[];const href=inputURL.replace('_240p.m3u8','.m3u8');const title="原畫";datas.push(buildEpisodeData(href,title,href));$next.toEpisodes(JSON.stringify(datas))}function Player(inputURL){$next.toPlayer(inputURL)}function Search(inputURL){}